import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { Box, Button, TextField } from '@mui/material';

export default function SelectLabels() {
    const [formData, setFormData] = React.useState({
        roomType: '',
        guests: '',
        checkInDate: null,
        checkOutDate: null,
    });
    const [error, setError] = React.useState(false);

    const handleRoomChange = (event) => {
        setFormData({ ...formData, roomType: event.target.value, guests: '' });
        setError(false);
    };

    const handleGuestsChange = (event) => {
        setFormData({ ...formData, guests: event.target.value });
    };

    const handleCheckInDateChange = (newDate) => {
        setFormData({ ...formData, checkInDate: newDate });
    };

    const handleCheckOutDateChange = (newDate) => {
        setFormData({ ...formData, checkOutDate: newDate });
    };

    const handleSubmit = () => {
        if (formData.roomType === 'kingDeluxe' && !formData.guests) {
            setError(true);
        } else {
            setError(false);
            // Submit all data at once (you can replace this with your actual submission logic)
            console.log('Form Data:', formData);
        }
    };

    return (
        <Box>
            {/* Room Type Selector */}
            <FormControl sx={{ m: 1, minWidth: 400 }}>
                <InputLabel id="room-type-label">Room Type</InputLabel>
                <Select
                    labelId="room-type-label"
                    id="room-type-select"
                    value={formData.roomType}
                    label="Room Type"
                    onChange={handleRoomChange}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value="kingDeluxe">King Deluxe Room</MenuItem>
                    <MenuItem value="deluxeDouble">Deluxe Double Room</MenuItem>
                </Select>
                <FormHelperText>Choose your room type</FormHelperText>
            </FormControl>

            {formData.roomType === 'kingDeluxe' && (
                <FormControl sx={{ m: 1, minWidth: 400 }} error={error}>
                    <InputLabel id="guests-label">Number of Guests</InputLabel>
                    <Select
                        labelId="guests-label"
                        id="guests-select"
                        value={formData.guests}
                        label="Number of Guests"
                        onChange={handleGuestsChange}
                    >
                        <MenuItem value="">
                            <em>None</em>
                        </MenuItem>
                        <MenuItem value={1}>1 Guest</MenuItem>
                        <MenuItem value={2}>2 Guests</MenuItem>
                    </Select>
                    {error && <FormHelperText>Number of guests is required</FormHelperText>}
                </FormControl>
            )}

            {/* Check-in Date Picker */}
            <LocalizationProvider dateAdapter={AdapterDayjs}>
                <Box sx={{ paddingLeft: 0, flexDirection: 'column', gap: 2, alignItems: 'center', marginTop: '20px' }}>
                    <DatePicker
                        label="Check-in Date"
                        value={formData.checkInDate}
                        onChange={handleCheckInDateChange}
                        renderInput={(params) => <TextField {...params} />}
                    />
                    <DatePicker
                        label="Check-out Date"
                        value={formData.checkOutDate}
                        onChange={handleCheckOutDateChange}
                        renderInput={(params) => <TextField {...params} />}
                    />
                </Box>
            </LocalizationProvider>

            {/* Submit Button */}
            <Button onClick={handleSubmit} variant="contained" color="primary">
                Submit
            </Button>
        </Box>
    );
}
